import React, { useEffect } from "react";
import { useFetch } from "../../hooks.js/useFetch";
import Styled from "./Admin.module.scss";

const Admin = () => {
  const { loading, response, error } = useFetch({
    url: "http://127.0.0.1:4000/api/v1/forms/attachPhoto",
    method: "get",
  });

  useEffect(() => {
    console.log(response);
  }, [response]);

  return (
    <div className={Styled.container}>
      <p>{loading ? "Loading..." : null}</p>
      {response &&
        response.forms.map((form) => (
          <div className={Styled.formBox} key={form.id}>
            <p>Имя: {form.name}</p>
            <p>Город: {form.city}</p>
            <p>Номер телефона: {form.phone_number}</p>
            <p>Коментарий: {form.comment}</p>
          </div>
        ))}
    </div>
  );
};

export default Admin;
